INSERT INTO `announcements` (`id`, `title`, `description`, `created_by`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Geg Study Group Session On 18 March 2017', '<p>GEG Study Group Session on 18 March 2017</p>\r\n<p>Choithram International School, as centre for all Google Education Group (GEG) activities in Madhya Pradesh, India, promotes use of GAFE tools in education.</p>\r\n<p>Around 30 teachers have registered for Level-1 certification. GEG study group sessions are organized for educators who aspire to become Google Leaders. The sessions are aimed at discussion on units to be studied, with hands-on practice and discussion on core concepts like Google Forms, Google Sites, Hangout, Google Groups, Gmail and Youtube.</p>', 'Admin', '1', '2017-04-01 04:41:52', '2017-04-01 04:41:52', NULL),
(2, 'Gsp Session For Choithram School North Campus, Indore On Saturday 15 April 2017', '<div id="js_6u" class="_5pbx userContent" data-ft="{">\r\n<p>A Skype session with the Director of The Climate Reality Project, India &ndash; Mr. Aditya Pundir &ndash; was organized for teachers of Choithram School North Campus, Indore on Saturday 15 April 2017. The session was aimed at briefing teachers on sustainability goals and the certification process required as a part of the Global Campaign for Sustainable Schools.</p>\r\n</div>', 'Admin', '1', '2017-04-20 11:01:20', '2017-04-20 11:01:47', NULL);
