(10, 2, 2, 'EY1 Theatre Day - The Jungle Book', 'Theatre show is a great way to let kids act out stories. Senior Kindergarteners celebrated Theatre Day by participating in play acts combining puppets, a script and a troupe of little actors. Young learners performed the roles of the characters of “The Jungle Book” movie and entertained their peers.', 1, '', '29', '2017-04-20 09:43:35', '2017-04-20 09:43:35'),
(11, 2, 2, 'EY1 Theatre Day - The Jungle Book Homework', 'Write a summary on how u have celebrated theatre day in your school.', 2, '', '29', '2017-04-20 09:43:35', '2017-04-20 09:43:35'),
(12, 2, 372, 'Classwork For Instrumental Music EY1A', '<p>An <strong>instrumental</strong> is a musical composition or recording without lyrics, or singing, although it might include some inarticulate vocals, such as shouted backup vocals in a Big Band setting. The music is primarily or exclusively produced by musical instruments. An instrumental can exist in music notation, after it is written by a composer; in the mind of the composer (especially in cases where the composer herself will perform the piece, as in the case of a blues solo guitarist or a folk music fiddle player); as a piece that is performed live by a single instrumentalist or a musical ensemble, which could range in size from a duo or trio to a large Big Band, concert band or orchestra.</p>', 1, '', '59', '2017-04-20 11:36:16', '2017-04-20 11:36:16'),
(13, 2, 372, 'Homework For Instrumental Music EY1A', '<p>An <strong>instrumental</strong> is a musical composition or recording without lyrics, or singing, although it might include some inarticulate vocals, such as shouted backup vocals in a Big Band setting. The music is primarily or exclusively produced by musical instruments. An instrumental can exist in music notation, after it is written by a composer; in the mind of the composer (especially in cases where the composer herself will perform the piece, as in the case of a blues solo guitarist or a folk music fiddle player); as a piece that is performed live by a single instrumentalist or a musical ensemble, which could range in size from a duo or trio to a large Big Band, concert band or orchestra.</p>', 2, '', '59', '2017-04-20 11:39:13', '2017-04-20 11:39:13'),
(14, 2, 2, 'Governing system of Germany', '<p>In accordance with the theme &ldquo;How we organise ourselves&rdquo; with the big idea \'Governing system\', Mr. Thomas Puetz, part of the parent community, interacted with the learners and shared information on the governing system of Germany. The learners gained valuable insight about Adolf Hitler and learned major reasons for people accepting a particular type of governance and various kinds of rules. He also emphasised the role of media and journalism in the governance of nation. It was an amazing learning session for the learners.</p>', 1, '', '29', '2017-04-21 09:11:57', '2017-04-21 09:11:57'),
(15, 2, 2, 'Homework On Governing system of Germany', '<p>Write a brief summary on how Governing system of Germany works.</p>', 2, '', '29', '2017-04-21 09:13:31', '2017-04-21 09:13:31'),
(16, 2, 370, 'Classwork on Artificial Intelligence', '<p>Artificial intelligence (AI) aims to or is required to synthesize goal-orientated processes such as problem-solving, decision-making, environmental adaptation, learning and communication found in humans and animals. From its origins in cybernetics and in the Dartmouth Conference (1956), artificial intelligence research has been necessarily cross-disciplinary, drawing on areas of expertise such as applied mathematics, symbolic logic, semiotics, electrical engineering, philosophy of mind, neurophysiology, and social intelligence. AI is associated in the popular mind with robotic development, but the main field of practical application has been as an embedded component in areas of software development, which require computational understanding. The starting-point in the late 1940s was Alan Turing\'s question "Can computers think?", and the question remains effectively unanswered although the Turing test is still used to assess computer output on the scale of human intelligence. But the automation of evaluative and predictive tasks has been increasingly successful as a substitute for human monitoring and intervention in domains of computer application involving complex real-world data.</p>', 1, '', '56', '2017-04-21 09:27:38', '2017-04-21 09:27:38'),
(17, 2, 370, 'Homework On Artificial Intelligence', '<p>This set of Artificial Intelligence MCQ focuses on &ldquo;Problem Solving Approach &ndash; 1&rdquo;</p>\r\n<p>The main task of a problem-solving agent is</p>\r\n<p>a) Solve the given problem and reach to goal<br />b) To find out which sequence of action will get it to the goal state<br />c) Both a) and b)<br />d) Neither a) nor b)</p>\r\n<p>&nbsp;What is state space?</p>\r\n<p>a) The whole problem<br />b) Your Definition to a problem<br />c) Problem you design<br />d) Representing your problem with variable and parameter<br />e) A space where you know the solution</p>\r\n<p>The problem-solving agent with several immediate options of unknown value can decide what to do by just examining different possible sequences of actions that lead to states of known value, and then choosing the best sequence. This process of looking for such a sequence is called Search. State True or False</p>\r\n<p>a) True<br />b) False</p>', 2, '', '56', '2017-04-21 09:31:24', '2017-04-21 09:34:57'),
