INSERT INTO `school_events` (`id`, `title`, `description`, `date`, `start_time`, `end_time`, `created_at`, `updated_at`) VALUES
(1, 'Annual Sports Day', '<p>The sports teacher helps and encourages students to participate in the &lsquo;Annual Sports Day&rsquo; function of the school. Students participate in various competing sports activities. The various sporting activities include flat race, hurdle race, cycling, high and long jump, etc. The participating students display their ability through these sports. The winner of these games gets a sense of proud.</p>\r\n<p>Sports help improve both physical and mental strength. Our body remains fit and healthy.</p>\r\n<p>Annual school sports is held at the pre-determined time and place. The spectators of Annual sports day function are the friends and relatives of the participating students. The students who didn&rsquo;t get the opportunity to participate in Annual Sport day also stand among the spectators to support their favourite candidates.</p>\r\n<p>Prizes are awarded to the winners by the Principal, Chief Guest and other honoured invitees.</p>\r\n<p>After the prize distribution ceremony, the &lsquo;Principal&rsquo; or the &lsquo;Head of Sports&rsquo; gives a short speech highlighting the importance of sports in our life. Students are encouraged to engage in sports and outdoor games on the regular basis. After this, the announcement for the close of the programs for the day is announced.</p>\r\n<p>Life is also just like a game. Sometimes, you win, and sometimes you lose. Participating in various games and sports develop&nbsp;a feeling of sporting spirit. In sports, the participating candidate may win or lose. The student learns to accept both victories&nbsp;and defeats with grace.</p>\r\n<p>Annual Sports ceremony is provides ample opportunity for healthy excitement and joy.</p>', '03-04-2017', '10:15 AM', '3:15 PM', '2017-03-31 11:43:20', '2017-03-31 11:43:20'),
(2, 'MONEY FOR ICE CREAM!', '<p>learners engaged in an Ice Cream Cone activity to demonstrate their understanding of money management when they go to an ice cream parlour to get their favourite scoop of ice cream. They decided on the amount of money they would like to spend on their favourite ice cream and described the notes and coins they wanted to add up to buy the cone of ice cream.</p>', '15-04-2017', '11:30 AM', '1:00 PM', '2017-04-20 10:54:42', '2017-04-20 10:54:42');
